import React from "react";
import styled from "styled-components";

const HamburgerBtn = styled.a`
  position: absolute;
  right: 100px;
  margin-top: 10px;
  display: none;
  span {
    position: absolute;
    transition: 0.3s ease-in-out;
    height: 3px;
    width: 30px;
    border-radius: 7px;
    background-color: #3d4146;
    top: 0;
    transition: 0.3s;
  }
  span:nth-child(1) {
    top: -5px;
  }
  span:nth-child(2),
  span:nth-child(3) {
    top: 5px;
  }
  span:nth-child(4) {
    top: 15px;
  }
`;
function HamburgerButton() {
  return (
    <HamburgerBtn>
      <span />
      <span />
      <span />
      <span />
    </HamburgerBtn>
  );
}

export default HamburgerButton;
